import React from "react";
import {Row, Col} from 'react-bootstrap';

import { Layout } from '../layout/Layout';
import { LoginForm } from '../components';

const Login = () => (
  <Layout heading="Login | Register">
    <Row>
     <Col className="col-lg-6"> 
     <LoginForm />    
     </Col>
    </Row>
  </Layout>
);

export default Login;
